import axios from "axios";
const BASE_URL = "http://localhost:5000/api/";
const TOKEN =
  "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyYzJlNzQ3ZDEzMzc1MWNjNjMzM2FhYSIsImlzQWRtaW4iOnRydWUsImlhdCI6MTY1NzgwMTI5NCwiZXhwIjoxNjU4MDYwNDk0fQ.ayIBkVdcp3zczZRh2dCGEABXdO6aMUIbZBvUUWmcK8M ";

export const publicRequest = axios.create({
  baseURL: BASE_URL,
});

export const userRequest = axios.create({
  baseURL: BASE_URL,
  header: { token: `Bearer ${TOKEN}` },
});
